import{_ as e,c,o,Q as t}from"./chunks/framework.f8572d03.js";const h=JSON.parse('{"title":"ES6 常用知识","description":"","frontmatter":{},"headers":[],"relativePath":"fe/es6/index.md","lastUpdated":1691942861000}'),d={name:"fe/es6/index.md"},a=t('<h1 id="es6-常用知识" tabindex="-1">ES6 常用知识 <a class="header-anchor" href="#es6-常用知识" aria-label="Permalink to &quot;ES6 常用知识&quot;">​</a></h1><p><code>ECMAScript 6</code> (简称 <code>ES6</code>) 是 <code>JavaScript</code> 语言的下一代标准</p><p><code>ECMAScript</code> 的提案流程</p><ul><li><code>Stage 0 - Strawman</code>（展示阶段）</li><li><code>Stage 1 - Proposal</code>（征求意见阶段）</li><li><code>Stage 2 - Draft</code>（草案阶段）</li><li><code>Stage 3 - Candidate</code>（候选人阶段）</li><li><code>Stage 4 - Finished</code>（定案阶段）</li></ul><p>一个提案只要能进入 <code>Stage 2</code> 就差不多肯定会包括在以后的正式标准里面</p><p><a href="https://github.com/tc39/ecma262" target="_blank" rel="noreferrer">ECMAScript 当前的所有提案</a></p><div class="tip custom-block"><p class="custom-block-title">ES6 和 ES2015 的区别</p><p><code>ES2015</code> 是一个年份标记，表示当年发布的 <code>ECMAScript</code> 标准的正式版本，其全称为《<code>ECMAScript 2015</code> 标准》（简称 <code>ES2015</code>）<br><code>ES6</code> 是一个历史名词也是一个泛指，含义是 <code>5.1</code> 版以后的 <code>JavaScript</code> 的下一代标准，涵盖了 <code>ES2015、ES2016、ES2017 ES2018</code> 等等</p></div>',7),i=[a];function r(s,p,l,S,n,_){return o(),c("div",null,i)}const m=e(d,[["render",r]]);export{h as __pageData,m as default};
